import React, { Fragment } from "react";
import "./App.css";

//components
import InputTodo from "./components/InputTodo";
// import EditTodo from "./components/EditTodo"
import ListTodos from "./components/ListTodos";

function App() {
  return (
    <Fragment>
      <div className="container">
        <InputTodo />
      </div>
      <div className="container">
        <ListTodos />
      </div>
    </Fragment>
  );
}

export default App;
